import React from "react";

export default function Section({ title, subtitle, dark, id, img_src }) {
  return (
    <div className={"section" + (dark ? " section-dark" : "")}>
      <div className="section-content" id={id}>
        <h1>{title}</h1>
        <img src={img_src}></img>
        <p className="section-text">{subtitle}</p>
      </div>
    </div>
  );
}
